import React from "react";
import { BrowserRouter as Router, NavLink } from "react-router-dom";
export default function Navpar() {
  return (
    <div>
      <Router>
        <nav>
          <NavLink end to={"/"}>
            Home
          </NavLink>
          <NavLink to={"/about"}>About</NavLink>
          <NavLink to={"/tail"}>TailWind</NavLink>
        </nav>
      </Router>
    </div>
  );
}
